import React from 'react'
import { Document } from 'react-pdf'
import MyResume from "../Assets/aarondenney_resume.pdf"

const Resume = () => {
    return (
        <div className = 'my-resume'>
            <Document file= {MyResume}/>
        </div>
    )
}

export default Resume
